import tensorflow as tf
import datetime

Input = tf.placeholder('float', shape=[None, 9], name="Input")
Target = tf.placeholder('float', shape=[None, 1], name="Target")
input_bias = tf.Variable(initial_value=tf.random_normal(shape=[10], stddev=0.4), dtype='float', name ='input_bias')

weights = tf.Variable(initial_value=tf.random_normal(shape=[9,10], stddev=0.4), dtype='float', name ='hidden_weights')
hidden_bias = tf.Variable(initial_value=tf.random_normal(shape=[1], stddev=0.4), dtype='float', name ='hidden_bias')
