tf.summary.histogram(name="Weights_2", values=output_weights)

hidden_layer = tf.matmul(Input, weights) + input_bias
hidden_layer = tf.sigmoid(hidden_layer, name="hidden_layer_activation")

output = tf.matmul(hidden_layer, output_weights) + hidden_bias
output = tf.sigmoid(output, name="output_layer_activation")

cost = tf.squared_difference(Target, output)
cost = tf.reduce_mean(cost)
tf.summary.scalar("error", cost)

learning_rate = 0.05
optimizer = tf.train.GradientDescentOptimizer(learning_rate).minimize(cost)

